import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Navbar from "react-bootstrap/Navbar";
// import { useState, useEffect } from "react";
// import JsonData from "../data/data.json";
import "../index.css";
import App from "../App";
import StagesOffres from "../views/stages-offres";
import StagesDemandes from "../views/stages-demandes";
import Inscription from "../views/inscription";
import Administration from "../views/administration";

// export const Navigation = () => {
//   const [landingPageData, setLandingPageData] = useState({});
//   useEffect(() => {
//     setLandingPageData(JsonData);
//   }, []);

export const Navigation = () => {
  //   const [landingPageData, setLandingPageData] = useState({});
  //   useEffect(() => {
  //     setLandingPageData(JsonData);
  //   }, []);

  return (
    <Router>
      <Navbar id="menu" bg="dark" variant="dark">
        <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">Features</Nav.Link>
          <Nav.Link href="#pricing">Pricing</Nav.Link>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-info">Search</Button>
        </Form>
      </Navbar>
      <br />
      <Navbar bg="primary" variant="dark">
        <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">Features</Nav.Link>
          <Nav.Link href="#pricing">Pricing</Nav.Link>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-light">Search</Button>
        </Form>
      </Navbar>

      <br />
      <Navbar bg="light" variant="light">
        <Navbar.Brand href="#home">Navbar</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">Features</Nav.Link>
          <Nav.Link href="#pricing">Pricing</Nav.Link>
        </Nav>
        <Form inline>
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />
          <Button variant="outline-primary">Search</Button>
        </Form>
      </Navbar>

      <div>
        <nav id="menu" className="navbar navbar-default navbar-fixed-top">
          <div className="container">
            <div className="navbar-header">
              <button
                type="button"
                className="navbar-toggle collapsed"
                data-toggle="collapse"
                data-target="#bs-example-navbar-collapse-1"
              >
                {" "}
                <span className="icon-bar"></span>{" "}
                <span className="icon-bar"></span>{" "}
                <span className="icon-bar"></span>{" "}
              </button>
              <a className="navbar-brand " href="#page-top">
                e Stage
              </a>{" "}
            </div>
            <div>
              <ul className="nav navbar-nav navbar-right">
                <li>
                  <Link to="/">À propos</Link>
                </li>
                <li>
                  <Link to="/stages-offres">Offres de stages</Link>
                </li>
                <li>
                  <Link to="/stages-demandes">Demande de stagiaire</Link>
                </li>
                <li>
                  <Link to="/inscription">Inscription</Link>
                </li>
                <li>
                  <Link to="/administration">Administration</Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>
        <Switch>
          <Route path="/App">
            <App />
          </Route>
          <Route path="/stages-offres">
            <StagesOffres />
          </Route>
          <Route path="/stages-demandes">
            {/* <StagesDemandes data={landingPageData.Stages} />  */}
            <StagesDemandes />
          </Route>
          <Route path="/inscription">
            <Inscription />
          </Route>
          <Route path="/administration">
            <Administration />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};
